            }

            .right-panel {
                width: 500px;
                height: 46px;
                background: #ECA30C;
                display: flex;
                align-items: center;

                .register-block {
                    display: flex;
                    align-items: center;
                    border-right: 1px solid white;
                    font-weight: 500;
                    font-size: 10px;
                    text-align: center;
                    color: #FFFFFF;

