                            top: 2px;
                            margin-right: 7px;
                        }
                    }

                    .search {
                        margin-right: 16px;
                    }
                }

                .soc-icons {
                    display: flex;
                    align-items: center;
                    margin: 0 48px 0 auto;

                    a {
                        &:not(:last-child) {
                            margin-right: 20px;
                        }
                    }
                }
            }
        }

    }
}

